import {React, useEffect, useState } from 'react';




let text;
  function Fetch() {

    const [isFetched, setIsFetched] = useState(false)

    useEffect( () => {

        async function fetchApi(){

          const data = await fetch('/api/user');
          text = await data.text();

          setIsFetched(true);

        }

        fetchApi()
      } 
      )


      return (
         isFetched && <div>
              Hello
              {text}
              {console.log(text)}
          </div>

      )
  }

  export default Fetch
